import { createAppContainer } from "react-navigation";
import { createStackNavigator } from "react-navigation-stack";

import Tutorial from "./../Tutorial/Tutorial";
import AboutPathFinding from "./../Tutorial/AboutPathFinding";

const tutorialNavigationStack = createStackNavigator({
  Tutorial: {
    screen: Tutorial,
  },
  AboutPathFinding: {
    screen: AboutPathFinding,
  },
});

const TutorialNavigationStack = createAppContainer(tutorialNavigationStack);

export default TutorialNavigationStack;
